// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DonationCampaign {
    struct Campaign {
        uint256 id;
        string title;
        string description;
        uint256 targetAmount;
        uint256 totalRaised;
        uint256 createdAt;
        bool isActive;
        address creator;
    }
    
    struct Donation {
        address donor;
        uint256 campaignId;
        uint256 amount;
        uint256 timestamp;
    }
    
    address public admin;
    uint256 public campaignCounter;
    uint256 public totalDonations;
    
    mapping(uint256 => Campaign) public campaigns;
    Donation[] public donations;
    
    event CampaignCreated(uint256 indexed campaignId, string title, string description, uint256 targetAmount);
    event DonationReceived(uint256 indexed campaignId, address indexed donor, uint256 amount, uint256 timestamp);
    event CampaignClosed(uint256 indexed campaignId, uint256 totalRaised);
    event FundsWithdrawn(uint256 indexed campaignId, address indexed admin, uint256 amount);
    
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }
    
    constructor() {
        admin = msg.sender;
        campaignCounter = 0;
    }
    
    // Admin tạo chiến dịch quyên góp mới
    function createCampaign(
        string memory _title,
        string memory _description,
        uint256 _targetAmount
    ) public onlyAdmin returns (uint256) {
        campaignCounter++;
        
        campaigns[campaignCounter] = Campaign({
            id: campaignCounter,
            title: _title,
            description: _description,
            targetAmount: _targetAmount,
            totalRaised: 0,
            createdAt: block.timestamp,
            isActive: true,
            creator: admin
        });
        
        emit CampaignCreated(campaignCounter, _title, _description, _targetAmount);
        return campaignCounter;
    }
    
    // Người dùng quyên góp vào chiến dịch
    function donate(uint256 _campaignId) public payable {
        require(msg.value > 0, "Donation must be greater than 0");
        require(campaigns[_campaignId].isActive, "Campaign is not active");
        
        campaigns[_campaignId].totalRaised += msg.value;
        totalDonations += msg.value;
        
        donations.push(Donation({
            donor: msg.sender,
            campaignId: _campaignId,
            amount: msg.value,
            timestamp: block.timestamp
        }));
        
        emit DonationReceived(_campaignId, msg.sender, msg.value, block.timestamp);
    }
    
    // Admin đóng chiến dịch
    function closeCampaign(uint256 _campaignId) public onlyAdmin {
        require(campaigns[_campaignId].isActive, "Campaign is already closed");
        
        campaigns[_campaignId].isActive = false;
        
        emit CampaignClosed(_campaignId, campaigns[_campaignId].totalRaised);
    }
    
    // Admin rút tiền từ chiến dịch về tài khoản
    function withdrawCampaign(uint256 _campaignId) public onlyAdmin {
        require(!campaigns[_campaignId].isActive, "Campaign must be closed before withdrawal");
        uint256 amount = campaigns[_campaignId].totalRaised;
        require(amount > 0, "No funds to withdraw");
        
        campaigns[_campaignId].totalRaised = 0;
        payable(admin).transfer(amount);
        
        emit FundsWithdrawn(_campaignId, admin, amount);
    }
    
    // Rút toàn bộ số dư contract (emergency)
    function withdrawAll() public onlyAdmin {
        uint256 balance = address(this).balance;
        require(balance > 0, "No funds to withdraw");
        payable(admin).transfer(balance);
    }
    
    // Lấy thông tin chiến dịch
    function getCampaign(uint256 _campaignId) public view returns (Campaign memory) {
        return campaigns[_campaignId];
    }
    
    // Lấy tất cả quyên góp
    function getAllDonations() public view returns (Donation[] memory) {
        return donations;
    }
    
    // Lấy quyên góp theo chiến dịch
    function getDonationsByCampaign(uint256 _campaignId) public view returns (Donation[] memory) {
        uint256 count = 0;
        
        // Đếm số lượng
        for (uint256 i = 0; i < donations.length; i++) {
            if (donations[i].campaignId == _campaignId) {
                count++;
            }
        }
        
        // Tạo mảng kết quả
        Donation[] memory result = new Donation[](count);
        uint256 index = 0;
        
        for (uint256 i = 0; i < donations.length; i++) {
            if (donations[i].campaignId == _campaignId) {
                result[index] = donations[i];
                index++;
            }
        }
        
        return result;
    }
    
    // Lấy số dư contract
    function getContractBalance() public view returns (uint256) {
        return address(this).balance;
    }
    
    receive() external payable {
        revert("Please use donate function with campaign ID");
    }
}

